import React from "react";
import Header from "./Header";

class Main extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <div className="main-wrapper">
          <div className="main">
            <div className="copy-container">
              <h1>Shuuhei Igarashi</h1>
              <p>Welcome to my page</p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Main;
